        icon:<bi.Adobe size={30} />,
        name: "Adobe"
    },
    {
        icon:<bi.Airbnb size={30} />,
        name: "Airbnb"
    },
    {
        icon:<bi.Android size={30} />,
        name: "Android"
    },
]

